sys_variable_value.value:
(function execute(inputs, outputs) {
  var m2m = inputs.contact_m2m_records

  // get package important contacts (e.g., MO and Financial POC)
  var records = [];
  while (m2m.next()) {
    var contact = m2m.contacts
    switch (contact.type.toString()) {
      case "MISSION_OWNER":
      case "FINANCIAL_POC":
        records.push(contact.sys_id.toString())
        break
      default:
        continue
    }
  }

  // get KO contact
  var TABLE = "x_g_dis_atat_contacts"
  var koRecord = new GlideRecord(TABLE)
  koRecord.addQuery("type", "JWCC_CONTRACTING_OFFICER")
  koRecord.query()
  koRecord.next()

  if (koRecord.isValidRecord()) {
  	records.push(koRecord.sys_id.toString())
  } else {
    var message = "No KO contact found in the Contacts table. "
    message += "Please provide one KO contact in the Contacts table."
  	gs.warn(message)
  }

  // query all relevant the records found by sys_id to output
  // as GlideRecords
  var glideRecords = new GlideRecord(TABLE)
  glideRecords.addQuery("sys_id", "IN", records)
  glideRecords.query()
  outputs.contact_records = glideRecords


})(inputs, outputs);

